import React from 'react'
import './Login.css'
function Login() {
	return (
		<div className="login">
			<img alt="" src="https://images-na.ssl-images-amazon.com/images/I/31%2BDgxPWXtL.jpg"
			className="login_logo"
			/>
		</div>
	)
}

export default Login
